; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Natural_phenomena"><span class="tocnumber">1</span> <span class="toctext">Natural phenomena</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Places"><span class="tocnumber">2</span> <span class="toctext">Places</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#Arts,_entertainment,_and_media"><span class="tocnumber">3</span> <span class="toctext">Arts, entertainment, and media</span></a> <ul> <li class="toclevel-2 tocsection-4"><a href="#Music"><span class="tocnumber">3.1</span> <span class="toctext">Music</span></a> <ul> <li class="toclevel-3 tocsection-5"><a href="#Albums"><span class="tocnumber">3.1.1</span> <span class="toctext">Albums</span></a></li> <li class="toclevel-3 tocsection-6"><a href="#Songs"><span class="tocnumber">3.1.2</span> <span class="toctext">Songs</span></a></li> </ul> </li> </ul> </li> <li class="toclevel-1 tocsection-7"><a href="#Other_uses"><span class="tocnumber">4</span> <span class="toctext">Other uses</span></a></li> <li class="toclevel-1 tocsection-8"><a href="#See_also"><span class="tocnumber">5</span> <span class="toctext">See also</span></a></li> </ul> </div> </div> <h2><span class="mw-headline" id="Natural_phenomena">Natural phenomena</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Hollow&amp;action=edit&amp;section=1" title="Edit section: Natural phenomena">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li>Hollow, a low, wooded area, such as a <a href="/wiki/Copse" class="mw-redirect" title="Copse">copse</a></li> <li>Hollow, a term meaning a small vee-shaped, <a href="/wiki/Valley#Hollows" title="Valley">riverine type of valley</a></li> <li><a href="/wiki/Tree_hollow" title="Tree hollow">Tree hollow</a>, a void in a branch or trunk, which may provide habitat for animals</li> </ul> <h2><span class="mw-headline" id="Places">Places</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Hollow&amp;action=edit&amp;section=2" title="Edit section: Places">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Sleepy_Hollow,_New_York" title="Sleepy Hollow, New York">Sleepy Hollow, New York</a>, a municipality formerly known as North Tarrytown</li> </ul> <h2><span id="Arts.2C_entertainment.2C_and_media"></span><span class="mw-headline" id="Arts,_entertainment,_and_media">Arts, entertainment, and media</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Hollow&amp;action=edit&amp;section=3" title="Edit section: Arts, entertainment, and media">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <dl> <dt>Fictional entities</dt> </dl> <ul> <li><a href="/wiki/Hollow_(Marvel_Comics)" class="mw-redirect" title="Hollow (Marvel Comics)">Hollow (Marvel Comics)</a>, a mutant formerly known as Penance</li> <li>Hollows, fictional beings in the manga and anime series <i>Bleach</i>, see <a href="/wiki/List_of_Hollows_in_Bleach" title="List of Hollows in Bleach">List of Hollows in <i>Bleach</i></a></li> </ul> <dl> <dt>Films</dt> </dl> <ul> <li><a href="/wiki/Hollow_(2011_drama_film)" title="Hollow (2011 drama film)"><i>Hollow</i> (2011 drama film)</a>, a 2011 American drama film</li> <li><a href="/wiki/Hollow_(2011_horror_film)" title="Hollow (2011 horror film)"><i>Hollow</i> (2011 horror film)</a>, a 2011 British horror film</li> <li><a href="/wiki/Hollow_(2014_film)" title="Hollow (2014 film)"><i>Hollow</i> (2014 film)</a>, a 2014 Vietnamese horror film</li> </ul> <dl> <dt>Literature</dt> </dl> <ul> <li><a href="/wiki/Hollows_(series)" title="Hollows (series)"><i>Hollows</i> (series)</a>, a series of novels and stories by Kim Harrison</li> <li>"<a href="/wiki/The_Legend_of_Sleepy_Hollow" title="The Legend of Sleepy Hollow">The Legend of Sleepy Hollow</a>", by Washington Irving</li> </ul> <h3><span class="mw-headline" id="Music">Music</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Hollow&amp;action=edit&amp;section=4" title="Edit section: Music">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li><a href="/wiki/Hollow_(band)" title="Hollow (band)">Hollow (band)</a>, a progressive power metal band from in Umeå, Sweden</li> </ul> <h4><span class="mw-headline" id="Albums">Albums</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Hollow&amp;action=edit&amp;section=5" title="Edit section: Albums">edit</a><span class="mw-editsection-bracket">]</span></span></h4> <ul> <li><a href="/wiki/Hollow_(Cesium_137_album)" class="mw-redirect" title="Hollow (Cesium 137 album)"><i>Hollow</i> (Cesium 137 album)</a>, 2006</li> <li><a href="/wiki/Hollow_(Digital_Summer_album)" title="Hollow (Digital Summer album)"><i>Hollow</i> (Digital Summer album)</a>, 2008</li> <li><i>Hollow</i>, a 2011 album by <a href="/wiki/Cut_Off_Your_Hands" title="Cut Off Your Hands">Cut Off Your Hands</a></li> </ul> <h4><span class="mw-headline" id="Songs">Songs</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Hollow&amp;action=edit&amp;section=6" title="Edit section: Songs">edit</a><span class="mw-editsection-bracket">]</span></span></h4> <ul> <li><a href="/wiki/Hollow_(Pantera_song)" title="Hollow (Pantera song)">"Hollow" (Pantera song)</a>, 1992</li> <li>"Hollow", a 2004 song by Submersed from <i><a href="/wiki/In_Due_Time" title="In Due Time">In Due Time</a></i></li> <li><a href="/wiki/Hollow_(Godsmack_song)" title="Hollow (Godsmack song)">"Hollow" (Godsmack song)</a>, 2006</li> <li>"Hollow", a 2009 song by Theatre of Tragedy from <i><a href="/wiki/Forever_Is_the_World" title="Forever Is the World">Forever Is the World</a></i></li> <li>"Hollow", a 2010 song by Parkway Drive from <i><a href="/wiki/Deep_Blue_(Parkway_Drive_album)" title="Deep Blue (Parkway Drive album)">Deep Blue</a></i></li> <li><a href="/wiki/Hollow_(Alice_in_Chains_song)" title="Hollow (Alice in Chains song)">"Hollow" (Alice in Chains song)</a>, 2013</li> <li>"Hollow", a 2015 song by Breaking Benjamin from <i><a href="/wiki/Dark_Before_Dawn" title="Dark Before Dawn">Dark Before Dawn</a></i></li> <li><a href="/wiki/Hollow_(Tori_Kelly_song)" title="Hollow (Tori Kelly song)">"Hollow" (Tori Kelly song)</a>, 2015</li> <li>"Hollow", a 2015 song by Mayday Parade from <i><a href="/wiki/Black_Lines" title="Black Lines">Black Lines</a></i></li> </ul> <h2><span class="mw-headline" id="Other_uses">Other uses</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Hollow&amp;action=edit&amp;section=7" title="Edit section: Other uses">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Hollow_Earth" title="Hollow Earth">Hollow Earth</a> theory, the idea that the planet Earth has a hollow interior and possibly an inhabitable inner surface</li> <li><a href="/wiki/Hollow-point_bullet" title="Hollow-point bullet">Hollow-point bullets</a></li> </ul> <h2><span class="mw-headline" id="See_also">See also</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Hollow&amp;action=edit&amp;section=8" title="Edit section: See also">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/The_Hollow_(disambiguation)" class="mw-disambig" title="The Hollow (disambiguation)">The Hollow (disambiguation)</a></li> </ul> <table id="disambigbox" class="metadata plainlinks dmbox dmbox-disambig" style="" role="presentation"> <tr> <td class="mbox-image" style="padding: 2px 0 2px 0.4em;"><a href="/wiki/File:Disambig_gray.svg" class=